import React from 'react';
import logo from '../../images/logo.svg';

function Formlist ({title, onSubmit, buttonText, children}) {
    
    return (
        <div className="Login__container">
            <div className="Formlist__logo">
                <img  src={logo} alt="логотип Улыбка"/>
            </div>
            <h2 className="Formlist__title">{title}</h2>
            <form name ={'Регистрация'} className="Login__form" onSubmit={onSubmit}>

                {children}

                <button type ="submit" aria-label="saveButton"
                    className="Login__button Login__button_invalid">{buttonText}
                </button>
                
            </form>
        </div>
    )
}

export default Formlist;
